import React,{useEffect} from 'react';
import { useSelector, useDispatch } from 'react-redux';

import * as actions from '../actions';
import { thunkSendMessage, planetsApi, VehiclesApi } from '../actions/thunkActions';
import logo from '../logo.svg';
import './App.css';
import { State } from '../reducers';
// import thunkSendMessage from '../actions/thunkActions'

const App = () => {
  useEffect(() =>{
    dispatch(planetsApi())
    dispatch(VehiclesApi())
  },[]
  )
  const message = useSelector((state: State) => state.message);
  const id = useSelector((state: State) => state.id);
  const planet=useSelector((state:State) => state.planet);
  const vehicle=useSelector((state:State) => state.vehicles);
  const dispatch = useDispatch();

  const onClick = () => {
    dispatch(actions.sampleAction2(id + 1));
    dispatch(thunkSendMessage('hello'));
  };
  return (
    <div className="App">
      <header className="App-header">
        message:
        {' '}
        {message}
        <img src={logo} className="App-logo" alt="logo" />
        id:
        {' '}
        {id}
        <button type="button" onClick={onClick}>
          increment id
        </button>

  {planet.map(planets => <h1>{planets.name} {planets.distance}</h1> )}
      </header>
    </div>
  );
};

export default App;
